import React from "react";
import { useNavigate } from "react-router-dom";
import { FiArrowLeft, FiSettings } from "react-icons/fi";

export default function MMIIVenoso() {
  const navigate = useNavigate();
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(120deg,#101824 0%,#1c2740 100%)",
      color: "#fff",
      fontFamily: "Segoe UI, Inter, Arial, sans-serif",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      paddingTop: 15,
      paddingBottom: 15,
    }}>
      <div style={{ position: "absolute", left: 25, top: 25, display: "flex", gap: 16 }}>
        <button
          onClick={() => navigate("/home")}
          style={{
            background: "#121e38", border: "none", borderRadius: 9, padding: 9,
            color: "#0eb8d0", fontSize: 24, cursor: "pointer"
          }}
          title="Voltar"
        >
          <FiArrowLeft />
        </button>
        <button
          onClick={() => navigate("/configuracoes")}
          style={{
            background: "#121e38", border: "none", borderRadius: 9, padding: 9,
            color: "#0eb8d0", fontSize: 24, cursor: "pointer"
          }}
          title="Configurações"
        >
          <FiSettings />
        </button>
      </div>
      <img 
        src="/venoai-logo.png" 
        alt="VENO.AI" 
        style={{ 
          width: 120, 
          marginBottom: 10, 
          filter: "drop-shadow(0 6px 20px #00e0ff90)",
          animation: "logoGlow 3s ease-in-out infinite alternate"
        }}
      />
      <h1 style={{ fontWeight: 700, fontSize: 28, letterSpacing: 1, color: "#0eb8d0", marginBottom: 8, fontFamily: 'Segoe UI, Inter, Arial, sans-serif' }}>
        Doppler Venoso MMII
      </h1>
      <div style={{ margin: "10px 0 15px", fontSize: 15, color: "#abfaff", fontFamily: 'Segoe UI, Inter, Arial, sans-serif' }}>
        (Aqui virá o formulário de exame conforme suas especificações)
      </div>
      <div style={{
        background: "rgba(255,255,255,0.07)",
        borderRadius: 12,
        padding: 32,
        minWidth: 320,
        maxWidth: 520,
        width: "100%",
        marginTop: 20,
        boxShadow: "0 2px 16px #00e0ff20"
      }}>
        <div style={{ textAlign: "center", color: "#0eb8d0", fontSize: 18, fontWeight: 500, fontFamily: 'Segoe UI, Inter, Arial, sans-serif' }}>
          Formulário de Doppler Venoso MMII<br/>
          <span style={{ fontSize: 13, color: "#abfaff" }}>
            (Aguardando suas instruções para os campos e lógica)
          </span>
        </div>
      </div>
      <style>
        {`
          @keyframes logoGlow {
            0% {
              filter: drop-shadow(0 8px 25px #00e0ff90);
            }
            100% {
              filter: drop-shadow(0 12px 35px #00e0ffc0);
            }
          }
        `}
      </style>
    </div>
  );
}
